SELECT "Generico_5"."Anunciante" AS "Datos (copia)",   SUM("Generico_5"."InversionUS") AS "TEMP(TC_)(2622528870)(0)",   "Generico_5"."Vehiculo" AS "Vehiculo",   SUM("Generico_5"."InversionUS") AS "sum:Calculation_0061002123102817:ok",   SUM(CAST("Generico_5"."NumAnuncios" AS BIGINT)) AS "sum:NumAnuncios:ok",   CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) AS "yr:FECHA:ok" FROM "Generico_5" WHERE (("Generico_5"."Anunciante" IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) IN (2014, 2015)) AND ("Generico_5"."Medio" = 'RADIO') AND (CAST(EXTRACT(MONTH FROM "Generico_5"."FECHA") AS BIGINT) IN (1, 2, 3, 4, 5))) GROUP BY "Generico_5"."Anunciante",   "Generico_5"."Vehiculo",   "yr:FECHA:ok" ORDER BY "Datos (copia)";
